import {React} from "react"

const Cart=()=>{
    useEffect(() =>{
        fetch('http://localhost:8080/api/getCart')
        .then((response)=>response.json())
        .then((data)=>{
            setData(data)
        }).catch((err)=>{
            console.log(err.message);
        });
    },[])
    
}
